var Base = require("base42");
var SetMfn2 = require("./SetMfn2");
var ExtendMfn2 = require("./ExtendMfn2");

var set = SetMfn2.make();

var Mod7 = Base.extend({
	name: "Mod7",
	set: set,
	instantiate: function(){
		this.set.apply(this, arguments);
		this.initialize();
	},
	initialize: function(){}
}).assign({
	extend: ExtendMfn2.make(),
	set: set
});

module.exports = Mod7;